import React, { useState } from "react";
import { Link } from "react-router-dom";
import { memo } from "react";

const Navbar = memo(() => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const toggleMenu = () => setIsMobileMenuOpen(!isMobileMenuOpen);

  const role = localStorage.getItem("role"); // Can be 'user' or 'admin'
  const token = localStorage.getItem("token");

  // Logout function
  const logout = () => {
    localStorage.removeItem("role");
    localStorage.removeItem("token");
    localStorage.removeItem("isadmin");
    localStorage.removeItem("artid");
    localStorage.removeItem("user");
    localStorage.removeItem("allowCOD");
    localStorage.removeItem("admin");
    localStorage.removeItem("artisanIdproduct");
    localStorage.removeItem("cart");
    localStorage.removeItem("adminId");
    localStorage.removeItem("name");

    window.location.href = "/"; // Redirect to home page or login page
  };

  // Links for normal users (logged-in users)
  const userLinks = (
    <>
      <li>
        <Link to="/" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Home
        </Link>
      </li>
      <li>
        <Link to="/productsList" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Products
        </Link>
      </li>
      <li>
        <Link to="/your-profile" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Profile
        </Link>
      </li>
      <li>
        <Link to="/contact" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Contact
        </Link>
      </li>
      <li>
        <Link to="/cart" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Cart <i className="fas fa-shopping-cart"></i>
        </Link>
      </li>
      <li>
        <button onClick={logout} className="text-white bg-red-500 hover:bg-red-600 px-4 py-2 rounded">
          Logout
        </button>
      </li>
    </>
  );

  // Links for admins
  const adminLinks = (
    <>
      <li>
        <Link to="/dashboard" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Dashboard
        </Link>
      </li>
      <li>
        <button onClick={logout} className="text-white bg-red-500 hover:bg-red-600 px-4 py-2 rounded">
          Logout
        </button>
      </li>
    </>
  );

  // Links for guests (not logged in)
  const guestLinks = (
    <>
      <li>
        <Link to="/" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Home
        </Link>
      </li>
      <li>
        <Link to="/productsList" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Products
        </Link>
      </li>
      <li>
        <Link to="/user-register" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Register
        </Link>
      </li>
      <li>
        <Link to="/user-login" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Login
        </Link>
      </li>
      <li>
        <Link to="/artisian-login" onClick={() => setIsMobileMenuOpen(false)} className="hover:text-yellow-500">
          Seller Login
        </Link>
      </li>
    </>
  );

  return (
    <nav className="w-full h-16 bg-gray-800 flex items-center justify-between px-4 fixed top-0 z-50">
      <div className="text-white text-xl font-bold">
        <Link to="/">E-Shopping 🛒</Link>
      </div>

      {/* Mobile Toggle Button */}
      <div className="text-white md:hidden" onClick={toggleMenu}>
        <i className={`fas ${isMobileMenuOpen ? "fa-times" : "fa-bars"} text-2xl`}></i>
      </div>

      {/* Mobile Menu */}
      <ul
        className={`text-white md:flex md:items-center md:space-x-6 absolute top-16 left-0 bg-gray-800 w-full md:w-auto md:bg-transparent md:h-auto transition-all transform ${
          isMobileMenuOpen ? "translate-y-0" : "-translate-y-full"
        } md:translate-y-0 md:flex-row flex-col space-y-4 md:space-y-0 px-4 py-2 z-50`}
      >
        {/* Display links based on login status and role */}
        {token ? (role === "artisan" ? adminLinks : userLinks) : guestLinks}
      </ul>
    </nav>
  );
});

export default Navbar;
